import { SvgIcon, Typography } from '@material-ui/core';
import { withStyles } from '@material-ui/core/styles';

export const StatusIcon = withStyles({
  root: {
    fontSize: '5em',
    color: 'green'
  }
})(SvgIcon);

export const Text = withStyles({
  root: {
    fontSize: '1em'
  }
})(Typography);
